import Link from 'next/link'
import Layout from '../components/Layout';

const Index = () => (
    <Layout>
        <div>내 정보 관리</div>
        <h2>
            <Link href="/signin">
                <a style={{background: 'black', color: 'white'}}>로그인</a>
            </Link>
            <Link href="/signup">
                <a>회원가입</a>
            </Link>
        </h2>
    </Layout>
);

export default Index;
